import React from "react";
import ReactDOM from "react-dom";

import App from "./App";
import LayoutPage from "./Components/LayoutPage";
import { ThemeProvider } from "./Hooks/themes";

ReactDOM.render(
  <React.StrictMode>
    <ThemeProvider>
      <LayoutPage>
        <App />
      </LayoutPage>
    </ThemeProvider>
  </React.StrictMode>,
  document.getElementById("root")
);

